import React from "react";

const Timeline = ({ records }) => {
  return (
    <div>
      <h2>Timeline</h2>
      <ul>
        {records.map((record, index) => (
          <li key={index}>
            <div>
              <h3>{record.title}</h3>
              <p>{record.description}</p>
            </div>
            <div>
              <p>{record.date}</p>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Timeline;
